import React from 'react'

export default function Info({ info }) {
    const components = info.map((i) => i)
    return (
        <div>
            {info.map((i, index) => {
                return <div className="wrapper">
                    <div key={index}>{i.metadata.title}</div>
                    <div key={index}>{i.metadata.text}</div>
                </div>
            }

            )}
        </div>
    )
}
